
SET FOREIGN_KEY_CHECKS=0;

CREATE TABLE IF NOT EXISTS  `region` (
  `id` int(11) NOT NULL auto_increment COMMENT '唯一编号',
  `code` varchar(30) NOT NULL COMMENT '地区编号',
  `name` varchar(512) NOT NULL COMMENT '地区名称',
  `parent_id` varchar(30) NOT NULL COMMENT '父编号',
  `level` tinyint NOT NULL COMMENT '类型1省2市3区县',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` timestamp NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP COMMENT '更新时间',
  `remark` varchar(512) default NULL COMMENT '备注',
  PRIMARY KEY  (`districts_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3657 DEFAULT CHARSET=utf8 COMMENT='区县级数据字典';


